import React from 'react'
import { Hero, Slider, AboutUs, ContactUs, Footer} from './components';

const App = () => {
  return (
    <div className='wrapper'>

        <Hero />
      <Slider />
      <AboutUs />
      <ContactUs />
      <Footer />
    </div>
  )
}

export default App
